import React from 'react';
import {Row, Col} from 'antd';


const EditMentors  = () => {

  return (
    <>
      <Row className='editMentors'>
        <Col span={12}>Delete Mentor</Col>
        <Col span={12}>Add Mentor</Col>
      </Row>
    </>
  );
}

export default EditMentors;
